import React from "react";
import "./Video.css";

function Video(props) {
  return (
    <div className="video-wrapper">
      <video src={props.src} controls width={props.width} height={props.height} />
      <p className="video-title">{props.title}</p>
    </div>
  );
}

export default Video;
